import React from 'react';

import NavBar from '../NavBar/NavBar';
import LoginBox from '../LoginBox/LoginBox';
import Grid from '@material-ui/core/Grid';


const LoginContainer = () => {
    return (
        <Grid
            container
            justify="center"
        >
            <NavBar />
            <Grid item xs={3}>
                <LoginBox />
            </Grid>

        </Grid>
    )
};

export default LoginContainer;
